text:
this is where i’m currently at in my approach to masculinity. i don’t see the problem as certain behaviors (although there a definitely some that are dangerous), but it’s the enforcement of those behaviors on others for whom that approach might not work for. the whole “you’re not a man if...” statement automatically raises a flag for me. if my wife’s makes more money than me, can i still be a man? yes. if i don’t like to shoot guns or hunt, am i a man? yes. if i love another man, am i still a man? yes. if i enjoy theater more than sports, am i still a man? yes. masculinity can have so many beautiful expressions. the issue is the small man box that has been built to contain a few characteristics that are then enforced on everyone else. for more on the man box, see: .
.
@remakingmanhood 
@wearemanenough 
@acalltomen 
@_evryman_ ....and those are just a few.
.
.
.
